"12477":{"id":"12477","name":"O Túmulo dos Vagalumes","slug":"o-tumulo-dos-vagalumes","original_title":"火垂るの墓","overview":"O filme relata a história de dois irmãos, Seita e Setsuko, no período da Segunda Guerra Mundial no Japão. O pai deles é convocado para defender o país na guerra, pois faz parte da marinha japonesa e a mãe falece em um bombardeio de aviões norte-americanos. A partir daí, o filme mostra a luta pela sobrevivência das duas crianças em meio à pobreza e miséria que assola o país. Fome, doenças e a falta de generosidade e sensibilidade dos adultos faz deste percurso um dos filmes mais bonitos e comoventes sobre o trágico quadro gerado pela guerra.","first_air_date":"1988-04-16","runtime":88,"episode_run_time":[88],"vote_average":8.5,"created_by":["Studio Ghibli"],"production_companies":[{"name":"Studio Ghibli"}],"cast":["辰巳努","白石綾乃","志乃原良子","山口朱美","Masayo Sakai"],"backdrop_path":"https://image.tmdb.org/t/p/original/tDFvXn4tane9lUvFAFAUkMylwSr.jpg","poster_path":"https://image.tmdb.org/t/p/original/kHFUyxNJfhMkKk1FwrNHd62KTEs.jpg","certification":"N/A","genres":["Animação","Drama","Guerra"],"trailer":"NAKlDJmwq-g"},
"1073164":{"id":"1073164","name":"Hora do Blec - Planeta Blec","slug":"hora-do-blec-planeta-blec","original_title":"Hora do Blec - Planeta Blec","overview":"Uma turma de personagens multiétnicos cujo protagonista - Blec - é um menino negro de 8 anos que, em suas mágicas missões com familiares e amigos, aciona seu talismã secreto: um pente garfo que vive em seu cabelo e através do qual ele faz contato com Lara, uma fadinha também negra, que orienta a turma em suas aventuras. Quando Blec puxa o pente seu cabelo arma virando um lindo e poderoso Black Power. A imagem de Blec traz consigo mensagens muito potentes que contribuem para a imagem e a autoestima de crianças, sobretudo negras, que encontram pouca representatividade no entretenimento como um todo.","first_air_date":"2021-01-01","runtime":20,"episode_run_time":[20],"vote_average":0.0,"created_by":["Ubuntu Filmes"],"production_companies":[{"name":"Ubuntu Filmes"}],"cast":["David Junior","Yasmin Garcez","Fábio Porchat","Dandara Mariana","Pedro Ogata"],"backdrop_path":"https://image.tmdb.org/t/p/original/wpZ5IDKkM7LQgdeZ3tmw4vSn4AP.jpg","poster_path":"https://image.tmdb.org/t/p/original/zF8bgoahgNOaHtZDTmExapsfiN6.jpg","certification":"L","genres":["Animação","Família"],"trailer":"a-SXz1I9cBw"},
